  },
  {
    field: 'studentName',
    headerName: 'Student Name',
    width: 150
  },
  {
    field: 'classID',
    headerName: 'Class ID'
  },
  {
    field: 'className',
    headerName: 'Class Name'
  },
  {
    field: 'semester',
    headerName: 'Semester'
  },
  {
    field: 'finalGrade',
    headerName: 'Final Grade'
  },

];

